/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `masuk_barang` AFTER INSERT ON `tbl_pembelian` FOR EACH ROW BEGIN 
UPDATE tbl_stok SET 
disc1 = NEW.disc1, disc2 = NEW.disc2, qty = qty+NEW.qty, harga_jual = NEW.harga_jual, harga_beli = NEW.harga_beli WHERE id=NEW.id_barang;
DELETE FROM tbl_stoktrace WHERE DATE_FORMAT(tanggal,'%d-%m-%Y') = DATE_FORMAT(new.tanggal_masuk,'%d-%m-%Y') AND id_barang=NEW.id_barang; 
INSERT INTO tbl_stoktrace SET id_barang = NEW.id_barang, 
nomor_part = (SELECT nomor_part FROM tbl_stok WHERE id=NEW.id_barang), 
jenis_part = (SELECT jenis_part FROM tbl_stok WHERE id=NEW.id_barang), 
stok_akhir=(SELECT qty FROM tbl_stok WHERE id=NEW.id_barang), 
tanggal=NOW(); 
END */;;
DELIMITER ;
