/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `masuk_barang_batal` AFTER DELETE ON `tbl_pembelian` FOR EACH ROW BEGIN 
UPDATE tbl_stok SET 
disc1 = OLD.disc1, disc2 = OLD.disc2, qty = qty-OLD.qty, harga_jual = OLD.harga_jual, harga_beli = OLD.harga_beli WHERE id=OLD.id_barang;
DELETE FROM tbl_stoktrace WHERE DATE_FORMAT(tanggal,'%d-%m-%Y') = DATE_FORMAT(OLD.tanggal_masuk,'%d-%m-%Y') AND id_barang=OLD.id_barang; 
INSERT INTO tbl_stoktrace SET id_barang = OLD.id_barang, 
nomor_part = (SELECT nomor_part FROM tbl_stok WHERE id=OLD.id_barang), 
jenis_part = (SELECT jenis_part FROM tbl_stok WHERE id=OLD.id_barang), 
stok_akhir=(SELECT qty FROM tbl_stok WHERE id=OLD.id_barang), 
tanggal=NOW(); 
END */;;
