/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `retur_masuk` AFTER INSERT ON `tbl_retur` FOR EACH ROW BEGIN
UPDATE tbl_stok SET qty = qty - NEW.qty WHERE id = NEW.id_barang;
UPDATE tbl_pembelian SET qty = qty - NEW.qty WHERE id_barang = new.id_barang AND nomor_faktur = NEW.nomor_faktur;
